// Array of icon partition
function partition(gesture, iconID) {
  var part = [];
  var xmin = 2;
  
  for(let k = 0; k < gesture.length; k++)
	  if(gesture[k][0] < xmin)
		xmin = gesture[k][0];
		
	xmin = xmin*484 + 5;
  
  for(let i = 0; i < coordinates.length; i++)
	for(let j = 0; j < iconID.length; j++)
	  if(iconID[j] == i+1)
		if (coordinates[i][1] > xmin)
		  part.push(iconID[j]);
		  
	return part;
}

