// This function is called when you check/uncheck "Type" and "Date"
function sort(s) {
	let tmp = [[2,75,100],[1,175,100],[2,275,100],[2,375,100],
			[1,75,180],[3,175,180],[3,275,180],[1,375,180],
			[1,75,260],[2,175,260],[1,275,260],[3,375,260],
			[4,75,340],[4,175,340],[4,275,340],[4,375,340],
			[1,75,420],[3,175,420],[2,275,420],[1,375,420],
			[4,75,500],[4,175,500],[4,275,500],[4,375,500],
			[2,75,580],[1,175,580],[2,275,580],[2,375,580]];
			
	switch(s){
		case 'type':
			if(date)
				bottom[0] = 4;
			else bottom[0] = 2;
			for(let i = 0; i < tmp.length; i++)
				for(let j = 0; j < tmp.length; j++){
					if(tmp[j][0] < tmp[i][0]){
						let tmp2 = tmp[i][0];
						tmp[i][0] = tmp[j][0];
						tmp[j][0] = tmp2;
					}
				}
			type = true;
			break;
			
		case 'date':
			if(type) {
				bottom[0] = 4;
				for(let i = 0; i < tmp.length; i++)
					for(let j = 0; j < tmp.length; j++){
						if(tmp[j][0] > tmp[i][0]){
							let tmp2 = tmp[i][0];
							tmp[i][0] = tmp[j][0];
							tmp[j][0] = tmp2;
						}
					}
			}
			else {
				bottom[0] = 3;
				for(let i = 0; i < tmp.length/2+1; i++){
					let j = tmp.length -1 -i;
					let tmp2 = tmp[i][0];
					tmp[i][0] = tmp[j][0];
					tmp[j][0] = tmp2;
				}
			}
			date = true;
			break;
			
		case 'dis-type':
			type = false;
			if(date){
				bottom[0] = 3;
				for(let i = 0; i < tmp.length/2+1; i++){
					let j = tmp.length -1 -i;
					let tmp2 = tmp[i][0];
					tmp[i][0] = tmp[j][0];
					tmp[j][0] = tmp2;
				}
			}
			else bottom[0] = 1;
			break;
			
		case 'dis-date':
			date = false;
			if(type){
				bottom[0] = 2;
				for(let i = 0; i < tmp.length; i++)
					for(let j = 0; j < tmp.length; j++)
						if(tmp[j][0] < tmp[i][0]){
							let tmp2 = tmp[i][0];
							tmp[i][0] = tmp[j][0];
							tmp[j][0] = tmp2;
						}
			}
			else bottom[0] = 1;
			break;
	}
	return tmp;
	
}

